import React, { useEffect } from 'react';
import useInsightState from './InsightState';
import Showsave from './details/Showsave';

function InsightSave() {
  const { callData, data } = useInsightState('save');

  useEffect(() => {
    callData();
    
  }, [callData]);

  return (
    <>
      {data ? (
        <Showsave/>
      ) : (
        <p>Loading...</p>
      )}
    </>
  );
}

export default InsightSave;
